import React from 'react';
import classes from './FooterList.module.css';

const Footer = (props) => (
  <>
    <li className={classes.List}>
      <p>
        <a className={classes.Anchor} href={props.redirect}>
          <span
            style={{
              backgroundImage: `url("${props.icon.join(', ')})`,
              width: '34px',
              height: '34px',
            }}
          ></span>
        </a>
      </p>
    </li>
  </>
);

export default Footer;
